addBook(_parent, {title, author, coverImage, categories, description}) {
            const book = {
                id: String(books.length + 1),
                title,
                author: author, 
                coverImage: coverImage,
                categories: categories,
                description: description,
            };
            books.push(book)
            return book;
        }

type books{
  id: ID!
  title: String!
  author: authors!
  coverImage: String
  categories: [categories]
  description: String
}

type authors{
  id: ID!
  firstName: String!
  lastName: String!
  books: [books]
}

type categories{
  id: ID!
  name: String!
  books: [books]
}

type Query{
  getBooks: [books!]
  getBook(id: ID!): books!
  getAuthors: [authors!]
  getCategories: [categories!]
}

type Mutation{
  addBook(
    title: String!
    author: ID!
    coverImage: String
    categories: [ID]!
    description: String
  ): books
}
